import React from "react";

const styles = {

    height: "80%",
    marginTop: "0px",
    marginLeft: "0px",
    display: "inline",
    position: "fixed",
    backgroundColor: "blue",
    textAlign: "center",
}

function Todo(){
    return(
        <div style = {styles}>
            <h1>this</h1>
            <h1>this</h1>
            <h1>this</h1>
            <h1>this</h1>
        </div>
    );
}

export default Todo;
